import React from 'react';
import './Roller1.css';

const Roller1 = () => {
  return (
    <div className="roller">
      <img src="/assets/david-martin-aWX5w5ZfT3A-unsplash 2.png" alt="Background landscape" className="david-martin-image" />
      <div className="overlay"></div>
      <img src="/assets/Vector 39.png" alt="Decorative vector" className="vector39" />
      <div className="frame238">
        <img src="/assets/_Colorown Spray & Roller Logos._001 1 (1).png" alt="Colorown Spray & Roller Logo" className="colorown-logo" />
        <span className="text-revolutionizing">Revolutionizing Aerial Painting</span>
      </div>
      <div className="drone">
        <img src="/assets/View_11_2024_05_02_001.png" alt="Drone view" className="view-image" />
        <div className="rectangle30"></div>
        <div className="rectangle29"></div>
        <div className="rectangle28"></div>
        <div src="/assets/Vector 38.png" className="vector38"></div>
        <div className="vector37"></div>
      </div>
      <div className="frame242">
        <div className="frame240">
          <span className="text-trail">Trail</span>
        </div>
      </div>
    </div>
  );
};

export default Roller1;
